import Layout from '../components/Layout';
import News from '../components/News';
import Jumbotron from '../components/Jumbotron';

const Index = props => (
  <Layout>
    <div>
      <Jumbotron />
      <br />
      <br />
      <News newsList={props.newsList} />
    </div>
    <style jsx>{`
      .bodily {
        background-color: blue;
        padding: 200px;
      }
    `}</style>
  </Layout>
);

export default Index;

